							<div><div><div>घटनाक्रम</div><div><br></div><div>1933 30 जनवरी - एडॉल्फ हिटलर जर्मनी के चांसलर बने। उनकी नाजी पार्टी, या तीसरा रैह, सत्ता लेता है और हिटलर अनिवार्य रूप से जर्मनी का तानाशाह है।</div><div><br></div><div>1936 25 अक्टूबर - नाजी जर्मनी और फासीवादी इटली ने रोम-बर्लिन धुरी संधि का गठन किया।</div><div><br></div><div>1936 25 नवंबर - नाजी जर्मनी और इंपीरियल जापान एंटी-कॉमिन्टर्न संधि पर हस्ताक्षर करते हैं। यह साम्यवाद और रूस के खिलाफ एक समझौता था।</div><div><br></div><div>1937 जुलाई 7 - जापान ने चीन पर हमला किया।</div><div><br></div><div>1938 12 मार्च - हिटलर ने ऑस्ट्रिया देश को जर्मनी में बदल दिया। इसे आन्क्स्लस भी कहा जाता है।</div><div><br></div><div>द्वितीय विश्व युद्ध</div><div><br></div><div>1939 1 सितंबर - जर्मनी ने पोलैंड पर हमला किया। द्वितीय विश्व युद्ध शुरू होता है।</div><div><br></div><div>1939 3 सितंबर - फ्रांस और ग्रेट ब्रिटेन ने जर्मनी के खिलाफ युद्ध की घोषणा की।</div><div><br></div><div>1940 9 अप्रैल से 9 जून - जर्मनी ने डेनमार्क और नॉर्वे पर आक्रमण किया और नियंत्रण किया।</div><div><br></div><div>1940 मई 10 से 22 जून - जर्मनी ने नीदरलैंड, बेल्जियम और उत्तरी फ्रांस सहित पश्चिमी यूरोप के अधिकांश हिस्सों पर कब्जा करने के लिए ब्लिट्जक्रेग, जिसका अर्थ है बिजली की लड़ाई, का इस्तेमाल किया।</div><div><br></div><div>1940 मई 30 - विंस्टन चर्चिल ब्रिटिश सरकार के नेता बने।</div><div><br></div><div>1940 10 जून - इटली ने एक्सिस शक्तियों के सदस्य के रूप में युद्ध में प्रवेश किया।</div><div><br></div><div>1940 जुलाई 10 - जर्मनी ने ग्रेट ब्रिटेन पर हवाई हमला किया। ये हमले अक्टूबर के अंत तक चले और ब्रिटेन की लड़ाई के रूप में जाना जाता है।</div><div><br></div><div>1940 22 सितंबर - जर्मनी, इटली और जापान ने त्रिपक्षीय संधि पर हस्ताक्षर करते हुए एक्सिस एलायंस का निर्माण किया।</div><div><br></div><div>1941 जून 22 - जर्मनी और एक्सिस पॉवर्स ने चार मिलियन से अधिक सैनिकों की एक बड़ी संख्या के साथ रूस पर हमला किया।</div><div><br></div><div>1941 दिसंबर 7 - जापानी ने पर्ल हार्बर में अमेरिकी नौसेना पर हमला किया। अगले दिन अमेरिका मित्र राष्ट्रों की ओर से द्वितीय विश्व युद्ध में प्रवेश करता है।</div><div><br></div><div>1942 4 जून - अमेरिकी नौसेना ने मिडवे की लड़ाई में जापानी नौसेना को हराया।</div><div><br></div><div>1942 जुलाई 10 - मित्र राष्ट्रों ने आक्रमण किया और सिसिली द्वीप ले लिया।</div><div><br></div><div>1943 सितंबर 3 - इटली मित्र राष्ट्रों के सामने आत्मसमर्पण करता है, हालांकि जर्मनी मुसोलिनी को उत्तरी इटली में सरकार से बचने और स्थापित करने में मदद करता है।</div><div><br></div><div>1944 6 जून - डी-डे और नॉरमैंडी आक्रमण। मित्र देशों की सेना ने फ्रांस पर आक्रमण किया और जर्मनों को पीछे धकेल दिया।</div><div><br></div><div>1944 25 अगस्त - पेरिस जर्मन नियंत्रण से मुक्त हुआ।</div><div><br></div><div>1944 16 दिसंबर - जर्मनों ने बुल्गे की लड़ाई में एक बड़ा हमला किया। वे जर्मन सेना के भाग्य को सील करने वाले मित्र राष्ट्रों से हार जाते हैं।</div><div><br></div><div>1945 फरवरी 19 - यूएस मरीन ने इवो जीमा द्वीप पर आक्रमण किया। एक भयंकर युद्ध के बाद वे द्वीप पर कब्जा कर लेते हैं।</div><div><br></div><div>1945 12 अप्रैल - अमेरिकी राष्ट्रपति फ्रैंकलिन रूजवेल्ट का निधन। वह राष्ट्रपति हैरी ट्रूमैन द्वारा सफल होता है।</div><div><br></div><div>1945 मार्च 22 - जनरल पैटन के तहत अमेरिका की तीसरी सेना राइन नदी को पार करती है।</div><div><br></div><div>1945 30 अप्रैल - एडोल्फ हिटलर ने आत्महत्या की क्योंकि वह जानता है कि जर्मनी युद्ध हार चुका है।</div><div><br></div><div>1945 मई 7 - जर्मनी ने मित्र राष्ट्रों के सामने आत्मसमर्पण किया।</div><div><br></div><div>1945 6 अगस्त - अमेरिका ने जापान के हिरोशिमा पर परमाणु बम गिराया। शहर तबाह हो गया है।</div><div><br></div><div>1945 9 अगस्त - नागासाकी, जापान पर एक और परमाणु बम गिराया गया।</div><div><br></div><div>1945 सितंबर 2 - जापान ने अमेरिकी जनरल डगलस मैकआर्थर और मित्र राष्ट्रों के सामने आत्मसमर्पण किया।</div></div></div>
						</div>
					</div>
				
